INSERT INTO `product` VALUES (0,'Ecco Domani174 Pinot Grigio - 750ml Bottle','','Gallo','','',0,0),(1,'Fresh Craft174 Mango Citrus - 4pk / 250ml Bottle','','Fresh Craft Co.','','Wine Beverage With Natural Flavors. A Little Sweet, A Little Tart, A Lot Of Good! Fresh Craft Co. Wine Cocktails Are Made With Crisp White Wine Infused With Natural Flavors Of Blackberry, Lemon A Hint Of Fizz. Deliciously Refreshing Craft Wine Cocktails. No Mixing, No Muddling, No Mess. Fresh Craft Co. Lets You Bring The Wine Cocktail Experience Anywhere You Go. Bottled By Fresh Craft Co. Modesto, California.brbrstoragebrstore And Drink Chilled.',1,0),(2,'1000 Stories174 Zinfandel - 750ml Bottle','','1000 Stories','','',2,0),(3,'Pink Moscato - 3l Bottle - Wine Cube153','','Wine Cube153','','Add A Sweet, Luscious Flavor Profile To Your Wine Rotation With The California Pink Moscato 3l - Wine Cube. This Creamy, Bright Boxed Wine Is Perfect For Brunch On The Patio Or As A Delightful Compliment To Crab, Chicken, Salads Or Dessert. Each Cube Contains The Equivalent Of 4 Bottles Of Wine, And Stays Fresh For Up To 4 Weeks.',3,0),(4,'Becks174 Non Alcoholic Beer - 6pk / 12oz Bottles','','Becks Na','','',4,0),(5,'Apothic174 Red Blend - 750ml Bottle','','Gallo','','Defy Convention. Apothic Red Is A Masterful Blend Of Intense Flavors And Luscious Texture Creates A Truly Unique Experience. Zinfandel Lends Notes Of Dark Fruit And Subtle Spice While Merlot And Syrah Bring Hints Of Black Fruit And A Smooth Mouthfeel. They Are Complemented By Cabernet Sauvignon That Contributes A Firm Structure And Bold Flavors. All Of The Varietals Combine To Offer Layers Of Dark Fruit That Are Enhanced By Soft Vanilla And Mocha Tones Leading To A Soft, Lasting Finish.brbrapothic Is A True Original. Named For The Mysterious Place, Apotheca, Where Vintners Stored Their Most Coveted Concoctions In 13th Century Europe, Apothic Blends Fuse Old World Intrigue With Modern Sophistication. Winemaker Debbie Juergenson Lets The Character And Flavor Of Each Varietal Guide The Shape Of Her Wines. In Addition To Apothic Red, Apothic White, Apothic Dark And Apothic Crush, Apothic Also Offers A Selection Of Limited Release Blends.',5,0),(6,'California Roots Moscato White Wine - 750ml','','California Roots','','The Best Ingredients For A Good Life Are Simple: Good Food, Good Friends And Good Wine. Crafted From Premium Grapes Grown Under The Warm California Sun, Our Moscatos Delicate Aromas, And Creamy Peach And Melon Flavors Make Every Day Feel A Little More Special. Enjoy Pure Vineyard-To-Table Goodness In Every Sip.brbrthe Delicate Aromas And Creamy Peach And Melon Flavors Of California Roots Moscato, Balanced By A Refreshing Acidity, Make Every Day Feel A Little More Special. Pairs Perfectly With Sweet, Freshly Picked Berries.',6,0),(7,'Charles Charles174 Red Blend - 750ml Bottle','','Charles Charles','','This Wine Is Expressive And Original, Bringing Together The Structure And Dense Black Currant Flavors Of Cabernet Sauvignon And The Sumptuous Dark Fruit And Spice Of Whole Cluster Syrah.',7,0),(8,'Fancy Pants174 Sauvignon Blanc - 750ml Bottle','','Fancy Pants','','',8,0),(9,'Martini Rossi174 Asti Spumante Sparkling Wine - 750ml Bottle','','Martini Rossi','','',9,0),(10,'603174 Winni Amber Ale - 6pk / 12oz Cans','','603 Brewery','','',10,0),(11,'603174 White Peaks Ipa - 6pk / 12oz Cans','','603 Brewery','','',11,0),(12,'Sofia Coppola174 Riesling - 750ml Bottle','','Coppola','','',12,0),(13,'California Roots Pinot Grigio White Wine - 750ml','','California Roots','','The Best Ingredients For A Good Life Are Simple: Good Food, Good Friends And Good Wine. Crafted From Premium Grapes Grown Under The Warm California Sun, Our Pinot Grigios Bright Citrus And Tropical Fruit Flavors Capture The Fresh, Easygoing Feeling Of Summer Any Time Of Year. Enjoy Pure Vineyard-To-Table Goodness In Every Sip.brbrthe Ripe Pear And Peach Aromas And Bright Citrus And Tropical Fruit Flavors Of California Roots Pinot Grigio Capture The Fresh, Easygoing Feeling Of Summer And Time Of The Year. Pairs Perfectly With Crisp Green Salads And Fresh Fish.',13,0),(14,'Sancho Libre174 Peach - 4pk / 12oz Cans','','Sancho Libre','','',14,0),(15,'Modern House174 With Love Red Blend - 750ml Bottle','','Modern House Wines','','',15,0),(16,'Estancia174 Cabernet Sauvignon - 750ml Bottle','','Estancia','','',16,0),(17,'Voga Italia174 Pinot Grigio - 750ml Bottle','','VOGA Italia','','',17,0),(18,'Michelob174 Ultra Light Cider Beer - 6pk / 12oz Bottles','','Michelob Ultra','','',18,0),(19,'Cabernet Shiraz - 3l Bottle - Wine Cube153','','Wine Cube153','','Enjoy The Velvety, Full-Bodied Appeal Of The California Cabernet Shiraz 3l - Wine Cube. This Luscious Red Boxed Wine Is The Natural Companion To Dark Chocolate As Well As Savory Barbecue And Smoked Meat Flavors. Each Cube Contains The Equivalent Of 4 Bottles Of Wine, And Stays Fresh For Up To 4 Weeks.',19,0),(20,'Cabernet Sauvignon - 3l Bottle - Wine Cube153','','Wine Cube153','','Experience The Lush, Full-Bodied Flavor Of The California Cabernet Sauvignon 3l - Wine Cube. This Beautifully Crafted Red Boxed Wine Is Known As The Ideal Pairing For Most Any Meat Dish, From Savory Short Ribs To Juicy Grilled Burgers. Each Cube Contains The Equivalent Of 4 Bottles Of Wine, And Stays Fresh For Up To 4 Weeks.',20,0),(21,'Risata174 Moscato Dasti - 750ml Bottle','','Risata','','',21,0),(22,'Barefoot174 Refresh Perfectly Pink - 750ml Bottle','','Barefoot','','Barefoot Refresh Perfectly Pink Is A Deliciously Vibrant Wine With Aromas Of Peach And Tangerine, Complemented By Flavors Of Raspberry. This Light-Bodied Wine Pairs Exceptionally Well With A Day By The Pool Or At The Beach, A Backyard Bbq, Or Any Barefoot Occasion!brbrdirectionsbrrefrigerate After Opening.',22,0),(23,'Tecate174 Beer - 12pk / 12oz Bottles','','Tecate','','A Lager Beer With A Delicious Aroma Of Malt And Hops And A Delicate Balance In Its Subtle Refreshing Taste. 12oz 12pk',23,0),(24,'Bud Light174 Raz-Ber-Rita - 12pk / 8oz Cans','','Bud Light','','Margarita With A Twist.try Over Ice!brbrdirectionsbrenjoy Responsibly.',24,0),(25,'California Roots Cabernet Sauvignon Red Wine - 750ml','','California Roots','','The Best Ingredients For A Good Life Are Simple: Good Food, Good Friends And Good Wine. Crafted From Premium Grapes Grown Under The Warm California Sun, Our Cabernet Sauvignons Juicy Cherry Flavors, Hints Of Oak And Graceful Finish Elevate Even The Simplest Pleasures. Enjoy Pure Vineyard-To-Table Goodness In Every Sip.brbrcalifornia Roots Cabernet Sauvignons Juicy Cherry And Black Current Flavors, With Hints Of Vanilla And Toasted Oak And A Bold, Graceful Finish, Elevate Even The Simplest Pleasures. Pairs Perfectly With Thick Ribeye Steaks.',25,0),(26,'Middle Sister174 Red Blend - 750ml Bottle','','Middle Sister','','A Sassy Blend Of Our Three Favorite Red Varieties Perfect For Sipping Before, During And After Our Favorite Family Meals.',26,0),(27,'Robert Mondavi Private Selection174 Bourbon Cabernet Sauvignon - 750ml Bottle','','Robert Mondavi Winery','','Our Coastal California Vineyards Deliver Deep Flavors Of Black Cherry And Blackberry To The Wine. The Next Step Is To Age A Select Portion Of The Blend In Bourbon Whiskey Barrels For At Least 3 Months, Adding Nuances Of Vanilla, Brown Sugar And Toasty Oak.',27,0),(28,'Riesling - 3l Bottle - Wine Cube153','','Wine Cube153','','Raise Your Glass Any Day Of The Week With The Riesling 3l - Wine Cube. This Bright, Crisp California Boxed Wine Is The Perfect Companion To Dishes With Acidity And Green Flavors Such As Lime And Jalapeo, But Is Also A Choice Patio Sipping Wine For Those Warm, Romantic Summer Nights.',28,0),(29,'Risata174 Pink Moscato - 750ml Bottle','','Risata','','',29,0),(30,'Middle Sister174 Moscato - 750ml Bottle','','Middle Sister','','',30,0),(31,'Love Noir174 Ros233 - 750ml Bottle','','Love Noir','','',31,0),(32,'Handsome Devil174 Malbec - 750ml Bottle','','Handsome Devil','','',32,0),(33,'Apothic174 White Blend - 750ml Bottle','','Apothic','','Defy Convention. Apothic White Blends Chardonnay, Riesling And Pinot Grigio To Create A Lively, Medium-Bodied Wine With Layers Of Vibrant Flavor. Riesling Lends The Wine Its Floral Notes And Energizing Acidity While Chardonnay Adds Texture And Body. Finally, Pinot Grigio Contributes Refreshing Flavors Of Juicy Pineapple, Peach, Pear And Apricot. Together They Are An Invigorating Balance Of Flavors And Freshness That Wrap With A Crisp, Balanced Finish.brbrapothic Is A True Original. Named For The Mysterious Place, Apotheca, Where Vintners Stored Their Most Coveted Concoctions In 13th Century Europe, Apothic Blends Fuse Old World Intrigue With Modern Sophistication. Winemaker Debbie Juergenson Lets The Character And Flavor Of Each Varietal Guide The Shape Of Her Wines. In Addition To Apothic Red, Apothic White, Apothic Dark And Apothic Crush, Apothic Also Offers A Selection Of Limited Release Blends.',33,0),(34,'Pinot Noir - 3l Bottle - Wine Cube153','','Wine Cube153','','Enjoy The Beautiful, Velvety Taste Of The Pinot Noir 3l - Wine Cube. This Medium-Bodied California Boxed Wine Will Be A Hit At Your Next Gathering, And Can Be Paired With Salmon, Roasted Chicken, Duck And More Or Simply Enjoyed On Its Own Or With A Tasty Cheese Plate.',34,0),(35,'Love Noir174 Pinot Noir - 750ml Bottle','','Love Noir','','',35,0),(36,'Promisqous174 Red Blend - 750ml Bottle','','Promisqous','','The Daring Dalliance Of Zinfandel, Merlot, Cabernet Sauvignon And Petit Sirah Produces This Plush And Seductive Red Wine That Partners Well With All Full-Flavored Foods.',36,0),(37,'Chardonnay - 3l Bottle - Wine Cube153','','Wine Cube153','','Celebrate The Season With The Light-Bodied, Bright Flavor Of The California Chardonnay 3l - Wine Cube. This Delightful Boxed White Wine Is The Natural Companion To Crab, Prawns And Other Shellfish As Well As Chicken Or Spring Vegetable Dishes. Each Cube Contains The Equivalent Of 4 Bottles Of Wine, And Stays Fresh For Up To 4 Weeks.',37,0),(38,'Red Blend - 500ml Bottle - Wine Cube153','','Wine Cube153','','Score Points For Taste At Your Next Shared Meal With The Smoothness Of The California Red Blend 500ml - Wine Cube. This Bodacious Boxed Vinters Wine Acts As The Perfect Pairing For Anything From Delicious Roasted Meats To Flavorful Pasta Dishes. Each Cube Contains The Equivalent Of 3 Glasses Of Wine, And Stays Fresh For Up To 4 Weeks.',38,0),(39,'Sauvignon Blanc - 3l Bottle - Wine Cube153','','Wine Cube153','','Celebrate The Light, Refreshing Notes Of The California Sauvignon Blanc 3l - Wine Cube. This Full-Bodied White Boxed Wine Is The Ideal Match With Fresh Oysters, Green Vegetables And Numerous Kinds Of Cheeses. Each Cube Contains The Equivalent Of 4 Bottles Of Wine, And Stays Fresh For Up To 4 Weeks.',39,0),(40,'California Roots Chardonnay White Wine - 750ml','','California Roots','','The Best Ingredients For A Good Life Are Simple: Good Food, Good Friends And Good Wine. Crafted From Premium Grapes Grown Under The Warm California Sun, Our Chardonnays Creamy Peach Flavors And Light Finish Remind You Of A Warm, Sunny Day At The Farmers Market. Enjoy Pure Vineyard-To-Table Goodness In Every Sip.brbrthe Rich Tropical Fruit Aromas And Creamy Peach And Juicy Apple Flavors Of California Roots Chardonnay Remind You Of A Warm, Sunny Day At The Farmers Market. Pairs Perfectly With Artisanal Cheeses And Freshly Baked Bread.',40,0),(41,'Red Blend - 3l Bottle - Wine Cube153','','Wine Cube153','','Experience The Smooth, Lush Flavor Of The Vinters Red Blend 3l - Wine Cube. This Rich California Table Wine Is An Easy Choice For Gatherings Of All Sizes, Or Simply As A Long-Lasting Option For The Everyday Wine Drinker. The Vinters Blend Pairs Beautifully With Anything From A Fancy Cheese Plate To A Juicy Steak.',41,0),(42,'Disaronno174 Almond Liqueur - 750ml Bottle','','Disaronno','','',42,0),(43,'Pinot Grigio - 500ml Bottle - Wine Cube153','','Wine Cube153','','Experience The Fruity, Complex Freshness Of The Pinot Grigio 500ml - Wine Cube. This Medium-Bodied Boxed White Wine Is A Solid Match With Seafood, Chicken And Pasta Dishes, And Is A Picnic-Perfect Take-Along For Your Next Outdoor Meal. Each Cube Contains The Equivalent Of 6 Glasses Of Wine, And Stays Fresh For Up To 4 Weeks.',43,0),(44,'California Roots Red Blend Wine - 750ml','','California Roots','','The Best Ingredients For A Good Life Are Simple: Good Food, Good Friends And Good Wine. Crafted From Premium Grapes Grown Under The Warm California Sun, Our Red Blends Smooth Berry And Cherry Flavors With Hints Of Spice Offer The Perfect Antidote To The Workweek. Enjoy Pure Vineyard-To-Table Goodness In Every Sip. Brbrcalifornia Roots Red Blend, With Bursting Berry And Cherry Flavors, Hints Of Spice And An Exceptionally Smooth Finish, Offers The Perfect Antidote To The Workweek. Pairs Perfectly With Wild Mushroom Pasta And Grilled Vegetables.',44,0),(45,'Chardonnay - 1l Bottle - Wine Cube153','','Wine Cube153','','Enjoy The Deliciously Refreshing, Light-bodied Taste Of The California Chardonnay 1l - Wine Cube. This Charming Boxed White Wine Is A Perfect Pairing Choice With Crab, Prawns And Other Shellfish As Well As Chicken Or Spring Vegetable Dishes. Each Cube Contains The Equivalent Of 6 Glasses Of Wine, And Stays Fresh For Up To 4 Weeks.',45,0),(46,'Fancy Pants174 Cabernet Sauvignon - 750ml Bottle','','Fancy Pants','','Not-Too-Dressy And Not-Too-Casual, This Wine Is Always Stylish And Always Delicious. Made From Grapes Sourced From Premier California Vineyards, Our Cabernet Is Playful And Approachable, With Lush Flavors Of Dark Berries, Sweet Vanilla, And Toasty Oak Character.',46,0),(47,'Beringer174 Be. Flirty Pink Moscato - 750ml Bottle','','Beringer','','',47,0),(48,'Fancy Pants174 Red Blend - 750ml Bottle','','Fancy Pants','','',48,0),(49,'Josh Cellars174 Ros233 - 750ml Bottle','','Josh Cellars','','Tasting Notes The Nose Is Bright With Aromas Of Fresh Strawberries, White Flowers And Stone Fruit. Dry, With Bursts Of Citrus, Peach And Strawberries, With A Crisp Finish. Brbrour Unique Ros Blend Is Sourced Across Diverse Northern Interior And Central Interior California Sites Sourcing That Creates Great Complexity, Balance, And A Classic Mediterranean Ros Profile.brbrpair This Crisp Ros With Light Summer Foods Like Goat Cheese, Gouda, Fresh Vegetables, And Seafood (for Example, Shrimp Cocktail, Oysters, Or Steamed Clams).',49,0),(50,'Sofia Rose 750ml Bottle','','Coppola','','Feminine And Stylish, With A Fragrant Perfume Of Fresh Strawberries And Lavender, This Ros Explodes With Ripe, Juicy Flavors Of Cherry, Raspberry And Citrus Zest. This Refreshing Wine Is Reminiscent Of The Popular Dry Ross Served In Seaside Caf Along The French Riviera.',50,0),(51,'Strongbow174 Gold Apple Hard Cider - 6pk / 11.2oz Bottles','','Strongbow','','',51,0),(52,'Spiked Seltzer174 Indian River Grapefruit - 6pk / 12oz Cans','','Spikedseltzer','','',52,0),(53,'Truly174 Colima Lime - 6pk / 12oz Bottles','','Truly Spiked Sparkling','','Spiked Sparkling Water With Natural Flavor. Colima Lime 6 Pkbrdirectionsbrplease Drink Responsibly.',53,0),(54,'Cupcake Vineyards174 Cabernet Sauvignon - 750ml Bottle','','Cupcake Vineyards','https://www.walmart.com/ip/Cupcake-Vineyards-Cabernet-Sauvignon-Wine-750mL/47333685','Our Vineyard Works Hard To Bring You The Richest, Smoothest Cabernet Sauvignon From Californias Desirable Central Coast, Where The Sun Drenched Grapes Create Full And Elegantly-Textured Wines. Scrumptious Flavors Of Decadent Dark Fruits, Molten Mocha And Toasty Oak Melt Into A Long, Silky Finish.',54,1),(55,'Truly174 Grapefruit Pomelo - 6pk / 12oz Bottles','','Truly Spiked Sparkling','','Spiked Sparkling Water With Natural Flavors. Grapefruit Pomelo 6pkbrdirectionsbrplease Drink Responsibly.',55,0),(56,'Cayman Jack174 Margarita Malt Beverage - 6pk / 11.2oz Bottles','','Margaritaville','','',56,0),(57,'George Killians174 Premium Irish Red - 6pk / 12oz Bottles'